$.aAR=H.c(['"A baby learns to crawl, walk and then run.  We are in the crawling stage when it comes to applying machine learning." ~Dave Waters',"\u201cWe have some catching up to do in the area of machine learning and artificial intelligence.\u201d ~Klaus Froehlich","\u201cArtificial Intelligence, deep learning, machine learning\u200a\u2014\u200awhatever you\u2019re doing if you don\u2019t understand it\u200a\u2014\u200alearn it. Because otherwise you\u2019re going to be a dinosaur within 3 years.\u201d ~Mark Cuban","\u201cJust as electricity transformed almost everything 100 years ago, today I actually have a hard time thinking of an industry that I don\u2019t think AI (Artificial Intelligence) will transform in the next several years.\u201d ~Andrew Ng","The field of Artificial Intelligence is set to conquer most of the human disciplines; from art and literature to commerce and sociology; from computational biology and decision analysis to games and puzzles.\u201d ~Anand Krish","\u201cMachine intelligence is the last invention that humanity will ever need to make.\u201d ~Nick Bostrom","\u201cArtificial intelligence would be the ultimate version of Google. The ultimate search engine that would understand everything on the web. It would understand exactly what you wanted, and it would give you the right thing. We\u2019re nowhere near doing that now. However, we can get incrementally closer to that, and that is basically what we work on.\u201d ~Larry Page","\u201cThe future is ours to shape. I feel we are in a race that we need to win. It\u2019s a race between the growing power of the technology and the growing wisdom we need to manage it.\u201d ~Max Tegmark"],t.i)
$.aoI=H.c(["Sunset is the time of day when our sky meets the outer space solar winds. There are blue, pink, and purple swirls, spinning and twisting, like clouds of balloons caught in a whirlwind. The sun moves slowly to hide behind the line of horizon, while the moon races to take its place in prominence atop the night sky. People slow to a crawl, entranced, fully forgetting the deeds that must still be done. There is a coolness, a calmness, when the sun does set.","On July 16, 1969, the Apollo 11 spacecraft launched from the Kennedy Space Center in Florida. Its mission was to go where no human being had gone before\u2014the moon! The crew consisted of Neil Armstrong, Michael Collins, and Buzz Aldrin. The spacecraft landed on the moon in the Sea of Tranquility, a basaltic flood plain, on July 20, 1969. The moonwalk took place the following day. On July 21, 1969, at precisely 10:56 EDT, Commander Neil Armstrong emerged from the Lunar Module and took his famous first step onto the moon\u2019s surface. He declared, \u201cThat\u2019s one small step for man, one giant leap for mankind.\u201d It was a monumental moment in human history!","Here is the perfect system for cleaning your room. First, move all of the items that do not have a proper place to the center of the room. Get rid of at least five things that you have not used within the last year. Take out all of the trash, and place all of the dirty dishes in the kitchen sink. Now find a location for each of the items you had placed in the center of the room. For any remaining items, see if you can squeeze them in under your bed or stuff them into the back of your closet. See, that was easy!","Oceans and lakes have much in common, but they are also quite different. Both are bodies of water, but oceans are very large bodies of salt water, while lakes are much smaller bodies of fresh water. Lakes are usually surrounded by land, while oceans are what surround continents. Both have plants and animals living in them. The ocean is home to the largest animals on the planet, whereas lakes support much smaller forms of life. When it is time for a vacation, both will make a great place to visit and enjoy.","The school fair is right around the corner, and tickets have just gone on sale. Even though you may be busy, you will still want to reserve just one day out of an entire year to relax and have fun with us. Even if you don\u2019t have much money, you don\u2019t have to worry. A school fair is a community event, and therefore prices are kept low. Perhaps, you are still not convinced. Maybe you feel you are too old for fairs, or you just don\u2019t like them. Well, that\u2019s what my grandfather thought, but he came to last year\u2019s school fair and had this to say about it: \u201cI had the best time of my life!\u201d While it\u2019s true that you may be able to think of a reason not to come, I\u2019m also sure that you can think of several reasons why you must come.  We look forward to seeing you at the school fair!","The Blue Whales just played their first baseball game of the new season; I believe there is much to be excited about. Although they lost, it was against an excellent team that had won the championship last year. The Blue Whales fell behind early but showed excellent teamwork and came back to tie the game. The team had 15 hits and scored 8 runs. That\u2019s excellent! Unfortunately, they had 5 fielding errors, which kept the other team in the lead the entire game. The game ended with the umpire making a bad call, and if the call had gone the other way, the Blue Whales might have actually won the game. It wasn\u2019t a victory, but I say the Blue Whales look like they have a shot at the championship, especially if they continue to improve.","Aspirin can be a fatal poison. People are used to taking aspirin whenever they feel pain. It is true that aspirin is an efficacious pain-killer for example in headache cases. However, aspirin is like any other medicine can be dangerously harmful. Any unregulated use of it may result into the damage to the lining of the stomach, prolonged bleeding time, nausea, vomiting, ulcers, liver damage, and hepatitis. It is scientifically proven that excessive use of aspirin turns it into a toxin. Its toxic effects are Kidney Damage, severe metabolic derangements, respiratory and central nervous system effects, strokes, fatal haemorrhages of the brain, intestines & lungs and eventually death. Thus, the careful and regulated use of aspirin is most advisable so as not to turn into a deadly poison."],t.i)
